import React from 'react';
import './index.css';
import Card from './Card';

function App() {
    return (
        <>
            <h1>Top 5 Netflix Series<span>- Yash Pandey</span></h1>
            
            <div class="row">
                <div class="col-md-4">
                    <Card />
                </div>

                <div class="col-md-4">
                    <Card />
                </div>

                <div class="col-md-4">
                    <Card />
                </div>

                <div class="col-md-4">
                    <Card />
                </div>

                <div class="col-md-4">
                    <Card />
                </div>
            </div>
        </>
    );
}

export default App;
